import React from 'react';
import '../../App.css';
import HeroSectionProfile from '../ProfilePrestataire/HeroSectionProfile/HeroSectionProfile';
import BarProfile3 from '../ProfilePrestataire/BarProfile/BarProfile3';
import PrestationAccepte from '../ProfilePrestataire/PrestationAccepte/PrestationAccepte';

function PrestationsAccepte() {
  return (
    <>
      <HeroSectionProfile/>
      <BarProfile3/>
      <PrestationAccepte/>
    </>
  );
}

export default PrestationsAccepte;
